import React from 'react'
import Player from 'player'

const Home = props => {
  function logIt(event) {
    console.log('fired')
    console.warn(event.target.files[0])
  }
  return(
  <div>
    <h1>Insert your video</h1>
    <label>Video file:</label>
    <input type="file"
      onChange = {logIt}
      accept=".mp4, .jpeg" />
      <Player/>
  </div>)
}
export default Home
